(2, 1, 'C', 'C002', 'Văn bản giới thiệu chuyên mục cuối trang', '<div><div>Nhadatexpress là 1 trong những website Bất động sản&nbsp;<span style=\"font-size: 1rem;\">hàng đầu Việt Nam - Giải pháp giúp tiếp cận hơn 10.000+ khách hàng mỗi ngày.Tại Nhà đất Express người dùng có thể tìm kiếm cho mình tất&nbsp;</span><span style=\"font-size: 1rem;\">cả các loại hình bất động sản như Nhà đất bán, Nhà đất cho thuê, Cần mua - Cần thuê và thông tin về những dự án một cách khách quan &amp; nhanh nhất.</span><span style=\"font-size: 1rem;\">Bạn đang xem thông tin tại mục <font color=\"#dc3545\">%chuyen_muc%</font></span><span style=\"font-size: 1rem;\">.&nbsp;</span></div><div><span style=\"font-size: 1rem;\">Đ</span><span style=\"font-size: 1rem;\">ể tìm thấy bất động sản nhanh nhất bạn nên sử dụng tính năng Tìm Kiếm Xung Quanh đề thấy được danh sách&nbsp;</span><span style=\"color: rgb(220, 53, 69); font-size: 16px;\">%chuyen_muc%</span><span style=\"font-size: 1rem;\">&nbsp;gần bạn nhất hoặc sử dụng tính năng Tìm kiếm Nâng cao để tìm th</span><span style=\"font-size: 1rem;\">ấy bất động sản hơp ý nhất</span><span style=\"font-size: 1rem;\">Nhadatexpress là 1 trong những website Bất động sản&nbsp;</span><span style=\"font-size: 1rem;\">hàng đầu Việt Nam - Giải pháp giúp tiếp cận hơn 10.000+ khách hàng mỗi ngày.Tại Nhà đất Express người dùng có thể tìm kiếm cho mình tất&nbsp;</span><span style=\"font-size: 1rem;\">cả các loại hình bất động sản như Nhà đất bán, Nhà đất cho thuê, Cần mua - Cần thuê và thông tin về những dự án một cách khách quan &amp; nhanh nhất.</span><span style=\"font-size: 1rem;\">Bạn đang xem thông tin tại mục&nbsp;</span><span style=\"color: rgb(220, 53, 69); font-size: 16px;\">%chuyen_muc%</span><span style=\"font-size: 1rem;\">.&nbsp;</span></div></div>', NULL, 2, NULL, 2),
