(15, NULL, 'N', 'N001', 'Ghi chú bước 1 quảng cáo express', '<p>Vị tr&iacute; quảng c&aacute;o <span style=\"color: #e03e2d;\"><strong>Trang chuy&ecirc;n mục 1</strong></span> c&oacute; k&iacute;ch thước</p>\r\n<p>300 x 600, ph&iacute; hiển thị mổi ng&agrave;y <strong><span style=\"color: #2dc26b;\">500 000 VNĐ</span></strong></p>', 1647277765, 1, NULL, NULL),
(16, NULL, 'N', 'N002', 'Hướng dẫn dưới bước 1 quảng cáo express', '<p><span style=\"color: #169179;\"><strong>🔰 Chọn vị tr&iacute; </strong><strong>hiện thị ph&ugrave; hợp</strong></span> để tối ưu h&oacute;a ng&acirc;n s&aacute;ch v&agrave; mục đ&iacute;ch Quảng C&aacute;o :<br /><br />➡️ Vị tr&iacute; trang chủ : Khả năng tiếp cận cao nhất <strong><span style=\"color: #3598db;\">ph&ugrave; hợp với doanh nghiệp</span></strong> c&oacute; nhu cầu truyền th&ocirc;ng, t&igrave;m kiếm kh&aacute;ch h&agrave;ng với quy m&ocirc; rộng, kh&ocirc;ng nhắm tới mục ti&ecirc;u kh&aacute;ch h&agrave;ng cụ thể</p>\r\n<p>➡️ Vị tr&iacute; trang chuy&ecirc;n mục <span style=\"color: #e03e2d;\"><em>( Đề Xuất )</em></span>&nbsp; :&nbsp; Tiếp cận đ&uacute;ng nh&oacute;m kh&aacute;ch h&agrave;ng mục ti&ecirc;u, gi&uacute;p tối ưu ng&acirc;n s&aacute;ch trong việc chuyển đổi kh&aacute;ch h&agrave;ng. <span style=\"color: #3598db;\"><strong>Ph&ugrave; hợp với ng&acirc;n s&aacute;ch vừa v&agrave; thấp</strong></span></p>', 1647277765, 1, NULL, NULL),
(17, NULL, 'N', 'N003', 'Ghi chú bước 2 quảng cáo express', '<p>☢️ Chiến dịch quảng c&aacute;o cần được x&eacute;t duyệt trước khi hiện thị tr&ecirc;n hệ thống website, Để quảng c&aacute;o được x&eacute;t duyệt sớm banner quảng c&aacute;o cần đ&aacute;p ứng c&aacute;c ti&ecirc;u ch&iacute; sau :<br /><br />+ <span style=\"color: #169179;\">K&iacute;ch thước banner</span> : 600x300 ( Pixel ) với banner <span style=\"color: #169179;\"><strong>Dọc 2 b&ecirc;n website tr&ecirc;n PC</strong></span> hoặc 600 x 600( px)&nbsp; với <span style=\"color: #3598db;\"><strong>banner Quảng c&aacute;o tr&ecirc;n thiết bị di động</strong></span><br />+ <span style=\"color: #169179;\">H&igrave;nh ảnh&nbsp;</span> : r&otilde; d&agrave;ng kh&ocirc;ng bị b&oacute;p m&eacute;o<br />+ <span style=\"color: #169179;\">Chủ đề&nbsp;</span> &nbsp;&nbsp; :&nbsp; Chỉ hiện thị c&aacute;c banner c&oacute; chủ đề li&ecirc;n quan đến <strong>Bất Động Sản</strong> hoặc <strong>Tuyển Dụng<br /></strong>+<strong> </strong><span style=\"color: #3598db;\"><span style=\"color: #ba372a;\">Dung lượng</span> </span><strong>: </strong>Kh&ocirc;ng qu&aacute; 1mb<strong><br /></strong></p>\r\n<p><span style=\"color: #236fa1;\"><em><strong>Trong trường hợp kh&ocirc;ng c&oacute; banner, Li&ecirc;n hệ với bộ phận CSKH để được hỗ trợ thiết kế banner miễn ph&iacute;</strong></em></span></p>', 1647277765, 1, NULL, NULL),
(18, NULL, 'N', 'N004', 'Ghi chú xuất hóa đơn cá nhân', '<p>🔰 Người d&ugrave;ng gửi y&ecirc;u cầu xuất h&oacute;a đơn điện tử tại đ&acirc;y, <span style=\"color: #236fa1;\">Những lưu &yacute; khi tiến h&agrave;nh xuất h&oacute;a đơn điện tử</span> :<br />➡️ H&oacute;a đơn điện tử được xuất từ ng&agrave;y 5 đến ng&agrave;y 10 h&agrave;ng th&aacute;ng<br />➡️ Kh&aacute;ch h&agrave;ng cần gửi y&ecirc;u cầu xuất h&oacute;a đơn trước ng&agrave;y 5. trong trường hợp gửi sau ng&agrave;y 5 h&oacute;a đơn c&oacute; thể phải nhận v&agrave;o đợt tiếp theo<br />➡️ Đơn h&agrave;ng c&oacute; gi&aacute; trị tr&ecirc;n 200k mới được xuất h&oacute;a đơn điện tử<br />➡️ Mỗi đơn h&agrave;ng chỉ được xuất h&oacute;a đơn 1 lần duy nhất<br /><br /><br /><br /></p>', 1647277765, 1, NULL, NULL),
(19, NULL, 'N', 'N005', 'Ghi chú xuất hóa đơn doanh nghiệp', '<p>🔰 Người d&ugrave;ng gửi y&ecirc;u cầu xuất h&oacute;a đơn điện tử tại đ&acirc;y, <span style=\"color: #236fa1;\">Những lưu &yacute; khi tiến h&agrave;nh xuất h&oacute;a đơn điện tử</span> :<br />➡️ H&oacute;a đơn điện tử được xuất từ ng&agrave;y 5 đến ng&agrave;y 10 h&agrave;ng th&aacute;ng<br />➡️ Kh&aacute;ch h&agrave;ng cần gửi y&ecirc;u cầu xuất h&oacute;a đơn trước ng&agrave;y 5. trong trường hợp gửi sau ng&agrave;y 5 h&oacute;a đơn c&oacute; thể phải nhận v&agrave;o đợt tiếp theo<br />➡️ Đơn h&agrave;ng c&oacute; gi&aacute; trị tr&ecirc;n 200k mới được xuất h&oacute;a đơn điện tử<br />➡️ Mỗi đơn h&agrave;ng chỉ được xuất h&oacute;a đơn 1 lần duy nhất</p>', 1647277765, 1, NULL, NULL),
(20, NULL, 'N', 'N006', 'Mẹo đăng tin hiệu quả', '<div class=\"body\">\r\n<p><span style=\"color: #ba372a;\"><strong>☢️LƯU &Yacute; </strong></span>:<span style=\"color: #2dc26b;\"> </span><span style=\"color: #169179;\"><em>Khi đăng tin kh&ocirc;ng li&ecirc;n quan đến BĐS t&agrave;i khoản người đăng sẽ bị kh&oacute;a m&agrave; kh&ocirc;ng cần b&aacute;o trước.<br /></em></span></p>\r\n<p><strong><span style=\"color: #236fa1;\">👉</span></strong><span style=\"color: #236fa1;\">H&igrave;nh ảnh </span>: C&aacute;c tin đăng c&oacute; h&igrave;nh ảnh &amp; r&otilde; n&eacute;t sẽ hiệu quả hơn c&aacute;c tin đăng kh&ocirc;ng c&oacute; h&igrave;nh ảnh. H&atilde;y Tối ưu k&iacute;ch thước h&igrave;nh ảnh của bạn nhỏ hơn 300Kb để tăng tốc độ trải nghiệm của kh&aacute;ch h&agrave;ng xem tin điều n&agrave;y sẽ gi&uacute;p tăng khả năng chuyển đổi đ&aacute;ng kể. Xem <a href=\"https://riot.softonic.vn/\" target=\"_blank\" rel=\"noopener\">Hướng Dẫn Tối Ưu h&igrave;nh trước khi đăng b&agrave;i</a></p>\r\n<p><strong><span style=\"color: #236fa1;\">👉</span></strong><span style=\"color: #236fa1;\">Ti&ecirc;u đề </span>: Thỏa m&atilde;n c&aacute;c ti&ecirc;u ch&iacute; k&iacute;ch th&iacute;ch sự t&ograve; m&ograve; của kh&aacute;ch h&agrave;ng, khẳng định được gi&aacute; trị của sản phẩm đang b&aacute;n, <span style=\"color: #e03e2d;\"><strong>Tối Đa 99 k&yacute; tự</strong></span></p>\r\n<p><strong><span style=\"color: #236fa1;\">👉</span></strong><span style=\"color: #236fa1;\">Nội dung</span>: Tin đăng sẽ hiểu quả hơn nếu đầy đủ th&ocirc;ng tin v&agrave; minh bạch về gi&aacute; b&aacute;n, ph&aacute;p l&yacute;. C&aacute;c tin đăng c&oacute; nội dung kh&ocirc;ng minh bạch sẽ kh&ocirc;ng được duyệt hiển thị tr&ecirc;n hệ thống &amp; t&agrave;i khoản c&oacute; thể bị hạn chế số lượng đăng tin trong ng&agrave;y. <span style=\"color: #2dc26b;\"><strong>Tối Thiểu 200 k&yacute; tự</strong></span></p>\r\n<p>👉 Xem th&ecirc;m Chi Tiết :<em> <br />✔️ </em><em><a href=\"../trang-chu\">C&aacute;ch đăng tin bất động sản hiệu quả</a><br />✔️ <a href=\"../\">C&aacute;c chạy quảng c&aacute;o bằng b&agrave;i viết tr&ecirc;n trang</a><br /></em><em>✔️ <a href=\"../\" target=\"_blank\" rel=\"noopener\">Marketing trong bất động sản - Cực Hay</a></em></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL),
(21, NULL, 'N', 'N007', 'Văn bản cuối trang đăng tin mới', '<div class=\"col-md-8\">\r\n<div class=\"outtro\">\r\n<p>Nh&agrave; đất Express l&agrave; website đăng tin với những t&iacute;nh năng cao cấp ưu việt nhất hiện nay. Người d&ugrave;ng c&oacute; thể đăng tin miễn ph&iacute; kh&ocirc;ng cần đăng nhập.&nbsp; Tuy nhi&ecirc;n để sử dụng được c&aacute;c t&iacute;nh năng cao cấp như: <span style=\"color: #e67e23;\">Thống k&ecirc; dữ liệu,&nbsp;</span><span style=\"color: #ba372a;\"><span style=\"color: #3598db;\"> Quản l&yacute; kh&aacute;ch h&agrave;ng,&nbsp;</span></span><span style=\"color: #169179;\"> Cộng đồng,&nbsp;</span><span style=\"color: #ba372a;\"> X&acirc;y dựng thương hiệu c&aacute; nh&acirc;n,&nbsp;</span><span style=\"color: #2dc26b;\"> Hỗ trợ </span><span style=\"color: #169179;\"><span style=\"color: #2dc26b;\">Email Marketing CSKH</span> </span>V&agrave; Được hỗ trợ duyệt tin trong thời gian nhanh nhất người d&ugrave;ng n&ecirc;n tạo cho m&igrave;nh 1 t&agrave;i khoản đăng tin ( ho&agrave;n to&agrave;n miễn ph&iacute; )<br />Mọi thắc mắc trong qu&aacute; tr&igrave;nh đăng tin qu&yacute; kh&aacute;ch vui l&ograve;ng <span style=\"color: #236fa1;\"><span style=\"color: #000000;\">Bộ Phận</span> <strong>Hỗ Trợ Kỹ Thuật</strong></span> Hoặc li&ecirc;n hệ:<br />Hotline CSKH :<strong> </strong><span style=\"color: #ba372a;\">090.777.2638</span> ( Giờ h&agrave;nh ch&iacute;nh ) để được hướng dẫn.</p>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL),
(22, NULL, 'C', 'C010', 'Thông báo đăng tin thành công', 'Đăng Tin Thành Công ! Tin Đăng Đang Được Xét Duyệt.', NULL, NULL, NULL, NULL),
(23, NULL, 'C', 'C011', 'Thông báo đăng tin thất bại', 'Đăng Tin Thất Bại ! Vui Lòng Kiểm Tra Lại Các Trường Thông Tin.', NULL, NULL, NULL, NULL),
