(25, 1, 'N', 'N008', 'Văn bản khi đăng kí tài khoản', '<p>T&agrave;i khoản d&agrave;nh ri&ecirc;ng cho kh&aacute;ch h&agrave;ng <span style=\"color: #2dc26b;\"><strong>c&oacute; nhu cầu cần mua - cần thu&ecirc;</strong></span> hoặc <strong><span style=\"color: #f1c40f;\"><span style=\"color: #e03e2d;\">ch&iacute;nh chủ</span> cần b&aacute;n v&agrave; cho thu&ecirc;</span></strong> Bất Động Sản. Kh&ocirc;ng hiện thị trong Mục <span style=\"color: #3598db;\"><strong>Danh Bạ</strong></span> tr&ecirc;n website, t&iacute;nh năng <span style=\"color: #843fa1;\"><strong>bảo mật th&ocirc;ng tin người đăng</strong></span> tr&aacute;nh bị l&agrave;m phiền. Được hỗ trợ 24/7</p>', NULL, NULL, NULL, NULL),
