(32, NULL, 'N', 'N011', 'Văn bản khi đăng kí tài khoản CVTV', '<p>T&agrave;i khoản d&agrave;nh cho <span style=\"color: #2dc26b;\"><strong>chuy&ecirc;n vi&ecirc;n tư vấn - người m&ocirc;i giới bất động sản</strong></span>. Dễ d&agrave;ng x&acirc;y dựng thương hiệu c&aacute; nh&acirc;n, <span style=\"color: #e03e2d;\"><strong>Quản l&yacute; &amp; Chăm s&oacute;c kh&aacute;ch h&agrave;ng</strong></span> to&agrave;n diện th&ocirc;ng qua <span style=\"color: #f1c40f;\"><strong>hệ thống CRM miễn ph&iacute;</strong></span>.</p>\r\n<p><span style=\"color: #3598db;\"><strong>Hiện thị trong mục Danh bạ</strong></span> gi&uacute;p kh&aacute;ch h&agrave;ng quan t&acirc;m BĐS dễ d&agrave;ng t&igrave;m kiếm v&agrave; chọn lựa người m&ocirc;i giới th&ocirc;ng qua dự &aacute;n m&ocirc;i giới đang triển khai v&agrave; khu vực đang sinh sống. Được hỗ trợ 24/7</p>', 1650512478, 1, NULL, NULL),
(33, NULL, 'N', 'N012', 'Văn bản khi đăng kí tài khoản doanh nghiệp', '<p><span style=\"color: #169179;\"><strong>D&agrave;nh ri&ecirc;ng cho doanh nghiệp</strong></span> ( Chủ đầu tư - C&ocirc;ng ty M&ocirc;i giới Bất Động Sản). Bao gồm tất cả c&aacute;c t&iacute;nh năng tr&ecirc;n website. Tiết kiệm tối đa với <span style=\"color: #e03e2d;\"><strong>khả năng chia sẻ g&oacute;i tin đăng</strong></span> cho t&agrave;i khoản li&ecirc;n kết. Dễ d&agrave;ng x&acirc;y dựng thương hiệu doanh nghiệp tr&ecirc;n m&ocirc;i trường online. Được hỗ trợ 24/7</p>\r\n<p>&nbsp;</p>', 1650512478, 1, NULL, NULL),
(34, 47, 'C', 'C017', 'Liên kết quảng cáo cho tiêu điểm', 'https://nhadatexpress.vn', 1650512478, 1, NULL, NULL),
(35, NULL, 'N', 'N013', 'Cơ chế tăng bậc', '<p><span style=\"color: #000000; font-family: -apple-system, BlinkMacSystemFont, Roboto, Oxygen, Ubuntu, Cantarell, sans-serif; font-size: medium; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"><span style=\"color: #3598db;\">C&aacute;ch 1:</span> &nbsp; Đăng đủ số lượng tin: đăng từ 0 -100 tin l&agrave; t&agrave;i khoản Thường, đăng từ 101 tin đ&ecirc;n 1000 tin l&agrave; t&agrave;i khoản Đồng, đăng từ 1001 tin đến 3000 tin l&agrave; t&agrave;i khoản Bạc, đăng từ 3001 tin đến 10.000 tin l&agrave; t&agrave;i khoản V&agrave;ng, tr&ecirc;n 10.000 tin l&agrave; t&agrave;i khoản Kim Cương.<br /><br /><span style=\"color: #3598db;\">C&aacute;ch 2:</span> &nbsp; Nạp đủ số coin: nạp từ 500k l&agrave; l&ecirc;n t&agrave;i khoản Đồng, nạp tr&ecirc;n 2 triệu l&agrave; t&agrave;i khoản Bạc, nạp tr&ecirc;n 25 triệu l&agrave; t&agrave;i khoản V&agrave;ng, nạp tr&ecirc;n 300 triệu l&agrave; t&agrave;i khoản Kim Cương.<br /></span></p>', 1650512478, 1, NULL, NULL),
