(7, 'Tài khoản %ten_nguoi_nhan% mua gói tin thành công', '<p>T&agrave;i khoản %ten_nguoi_dung% đ&atilde; được duyệt mua g&oacute;i tin th&agrave;nh c&ocirc;ng</p>\r\n<p>&nbsp;</p>', 'duyet_mua_Goi_tin_thanh_cong', 0, 1, 1653879227, 1, 1653883077, 1, NULL, 0, 0),
