(10, 'Cảnh báo chặn cấm tài khoan %ten_nguoi_nhan%', '<p>Cảnh b&aacute;o chặn cấm t&agrave;i khoản %ten_nguoi_nhan%</p>\r\n<p>T&agrave;i khoản của qu&yacute; kh&aacute;ch hiện đ&atilde; vi phạm %so_lan% khi qu&yacute; kh&aacute;ch đăng tin chứa từ kh&oacute;a dẫn đến tin đăng kh&ocirc;ng được duyệt&nbsp;</p>\r\n<p>Lưu &yacute; : Khi t&agrave;i khoản của qu&yacute; kh&aacute;ch khi vi phạm %so_lan% sẽ bị chặn&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Bị Chặn đăng 7 ng&agrave;y %so_lan% sẽ bị cấm vĩnh viễn</p>', 'chan_cam_tai_khoan', 0, 1, 1653881691, 1, NULL, NULL, NULL, 0, 0),
