(13, 'ND66690929', 7, 102, 71, 'Trung tâm Thương mại-Dịch vụ Long Hậu test 1', 'Trung tâm Thương mại-Dịch vụ Long Hậu tọa lạc ở vị trí trung tâm KCN Long Hậu, ngay giao lộ trung tâm công viên, góc ngã tư đường Long Hậu và đường Trung Tâm. Đây được coi là vị trí chiến lược, tiếp giáp với cửa ngõ TP.HCM, thuận lợi cho lưu thông và vận chuyển hàng hóa từ các tỉnh, thành lân cận.\r\n\r\n3km đến Cảng Container Trung tâm Sài Gòn (SPCT) và Cảng Sài Gòn – Hiệp Phước\r\n12km đến Khu đô thị Phú Mỹ Hưng\r\n19km đến trung tâm TP. Hồ Chí Minh\r\n25km đến cảng Cát Lái\r\n25km đến Sân bay Tân Sơn Nhất', 'trung-tam-thuong-mai-dich-vu-long-hau-test-11666690929', NULL, NULL, 1000, 7, NULL, 2, 3, NULL, 3, 7, NULL, 19, 25, NULL, NULL, NULL, NULL, NULL, NULL, '[\"uploads\\/users\\/7371483968\\/ujFzmewjxe5mPIrRwUt9.png\",\"uploads\\/users\\/7371483968\\/1mfHZ3DXjxauo7ksfTqD.jpeg\"]', NULL, NULL, 1, NULL, 1666690930, 1666777330, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Trung tâm Thương mại-Dịch vụ Long Hậu test 1', 'từ khóa test', 'Trung tâm Thương mại-Dịch vụ Long Hậu tọa lạc ở vị trí trung tâm KCN Long Hậu, ngay giao lộ trung tâm công viên, góc ngã tư đường Long Hậu và đường Trung Tâm. Đây được coi là vị trí chiến lược, tiếp giáp với cửa ngõ TP.HCM, thuận lợi cho lưu thông và vận chuyển hàng hóa từ các tỉnh, thành lân cận.\r\n\r\n3km đến Cảng Container Trung tâm Sài Gòn (SPCT) và Cảng Sài Gòn – Hiệp Phước\r\n12km đến Khu đô thị Phú Mỹ Hưng\r\n19km đến trung tâm TP. Hồ Chí Minh\r\n25km đến cảng Cát Lái\r\n25km đến Sân bay Tân Sơn Nhất', 0, 1, 1, 1, 0, 1666690929, 1666691489, 1682182800, NULL, 53, 53, NULL, 0, 1666630800, NULL, NULL, NULL, NULL);
