(43, 43, NULL, 'Hàng bột nở uy tín', NULL, '<p style=\"text-align: left;\">Tổng quan<br />Khu đ&ocirc; thị<strong>&nbsp;Vinh New Center&nbsp;</strong>ti&ecirc;n phong tạo lập tổ ấm hiện đại, đẳng cấp đầu ti&ecirc;n tại x&atilde; Nghi Li&ecirc;n, th&agrave;nh phố Vinh, tỉnh Nghệ An do c&ocirc;ng ty CP X&acirc;y dựng Sơn H&agrave; triển khai đầu tư. Với quy hoạch 148 l&ocirc; liền kề, biệt thự, nh&agrave; cao tầng, c&ocirc;ng vi&ecirc;n, nh&agrave; sinh hoạt cộng đồng KĐT Vinh New Center sẽ l&agrave; điểm dừng ch&acirc;n l&yacute; tưởng d&agrave;nh cho giới tinh hoa.<br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125142247-5443.jpg\" /><span style=\"font-size: 10pt;\"><em>Phối cảnh dự &aacute;n Khu đ&ocirc; thị Vinh New Center</em>&nbsp;</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p>&nbsp;</p>', 'hang-bot-no-uy-tin', '<p>Khu đ&ocirc; thị Vinh New Center tọa lạc tr&ecirc;n tuyến đường Quốc Lộ 1A cũ (đường Thăng Long), x&atilde; Nghi Li&ecirc;n, l&agrave; trục giao th&ocirc;ng xương sống kh&ocirc;ng chỉ ri&ecirc;ng TP. Vinh m&agrave; c&ograve;n cả Nghệ An &amp; cả nước, đ&acirc;y sẽ l&agrave; cơ hội, tiềm năng ph&aacute;t triển rất lớn.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125170125-0c6b.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Vị tr&iacute; dự &aacute;n Vinh New Center&nbsp;</em> </span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><em>Dự &aacute;n nằm ở vị tr&iacute; trung t&acirc;m của khu vực, dễ d&agrave;ng tiếp cận c&aacute;c c&ocirc;ng tr&igrave;nh thiết yếu.&nbsp;<br />- Đối diện bến xe Bắc Vinh.&nbsp;<br />- 50m đến s&acirc;n bay Vinh.&nbsp;<br />- 200m đến KCN Bắc Vinh.&nbsp;<br />- 300m đến đại lộ 72m Vinh - Cửa L&ograve;.&nbsp;<br />- 500m đến chợ Vinh - Big C.&nbsp;</em></span></p>', '<p>Khu đ&ocirc; thị Vinh New Center sở hữu phong c&aacute;ch thiết kế nh&agrave; ở tinh tế, lịch l&atilde;m mang hơi hướng tối giản đang được ưa chuộng ng&agrave;y nay. L&agrave; chốn an cư l&iacute; tưởng theo xu thế hiện đại, nơi cuộc sống kh&ocirc;ng chỉ bị bao bọc bởi bốn bức tường m&agrave; mở rộng v&agrave; h&ograve;a hợp với thi&ecirc;n nhi&ecirc;n m&agrave; l&agrave; nơi cuộc sống l&agrave; sự tận hưởng đ&uacute;ng nghĩa.</p>\r\n<p>Dự &aacute;n nằm c&aacute;ch trung t&acirc;m TP Vinh kh&ocirc;ng xa, nhưng mang đến cảm nhận kh&aacute;c biệt r&otilde; n&eacute;t giữa sự s&ocirc;i động, ồn &agrave;o của phố x&aacute; với một kh&ocirc;ng gian m&aacute;t mẻ, trong l&agrave;nh v&agrave; y&ecirc;n tĩnh, phủ đầy c&acirc;y xanh. Với thiết kế n&agrave;y tạo n&ecirc;n diện mạo sang trọng cho khu phố, t&ocirc;n vinh c&aacute;c chủ nh&acirc;n, n&acirc;ng tầm gi&aacute; trị cuộc sống.</p>\r\n<p>Hướng tới tiện &iacute;ch sống khỏe, sống xanh, khu c&ocirc;ng vi&ecirc;n ri&ecirc;ng tư được quy hoạch trong khu&ocirc;n vi&ecirc;n KĐT.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125145023-bf9d.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tiện &iacute;ch Khu đ&ocirc; thị Vinh New Center</em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125145105-a7b0.jpg\" /> </em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tiện &iacute;ch Khu đ&ocirc; thị Vinh New Center&nbsp; </em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125145120-2722.jpg\" /> </em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tiện &iacute;ch Khu đ&ocirc; thị Vinh New Center&nbsp; </em></span></p>', '<p>Khu đ&ocirc; thị Vinh New Center do c&ocirc;ng ty CP Kiến tr&uacute;c QTA &nbsp;tư vấn lập quy hoạch. Với c&aacute;c tiện &iacute;ch đa dạng, kh&ocirc;ng gian sinh th&aacute;i trong l&agrave;nh, cộng đồng cư d&acirc;n văn minh, hạnh ph&uacute;c v&agrave; h&ograve;a hợp về phong c&aacute;ch sống.</p>\r\n<p style=\"text-align: center;\"><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125150640-53e3.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Phối cảnh mặt bằng tổng thể khu đ&ocirc; thị Vinh New Center</em>&nbsp;</span></p>\r\n<p>Dự &aacute;n với quy m&ocirc; lớn bao gồm 148 l&ocirc; liền kề, biệt thự, nh&agrave; cao tầng, c&ocirc;ng vi&ecirc;n, nh&agrave; sinh hoạt cộng đồng, trong đ&oacute; c&oacute; nhiều loại diện t&iacute;ch.</p>\r\n<p>Diện t&iacute;ch từ 93m2, 136m2, 180m2, 200m2 &nbsp;với mặt tiền từ 5.5, 8m, 11m &nbsp;- đường quy hoạch rộng từ 11m tới 15m.</p>\r\n<p style=\"text-align: center;\"><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125151125-d361.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Thiết kế nh&agrave; phố Khu đ&ocirc; thị Vinh New Center&nbsp;</em>&nbsp;</span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125153127-7443.jpg\" /> </span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Thiết kế nh&agrave; phố Khu đ&ocirc; thị Vinh New Center&nbsp;</em> </span></p>', '<p>Dự &aacute;n Vinh New Center được chủ đầu tư c&ocirc;ng ty CP X&acirc;y dựng Sơn H&agrave; mở b&aacute;n v&agrave;o th&aacute;ng 1 năm 2022. Hiện tại c&aacute;c nền ph&acirc;n l&ocirc; đ&atilde; được khởi c&ocirc;ng v&agrave; từng bước triển khai.</p>\r\n<p style=\"text-align: center;\"><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125152044-92fe.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tiến độ dự &aacute;n Khu đ&ocirc; thị Vinh New Center th&aacute;ng 1 năm 2022</em> </span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125152128-3156.jpg\" /> </em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tiến độ dự &aacute;n Khu đ&ocirc; thị Vinh New Center th&aacute;ng 1 năm 2022 </em></span></p>', '<p>G&iacute;a b&aacute;n dự &aacute;n<strong>&nbsp;</strong>Khu đ&ocirc; thị Vinh New Center dự kiến chỉ từ 14 &ndash; 17 triệu/m2. ( G&iacute;a đất ).</p>', 7, 1000, 8, '500.00', NULL, 1, '12.50', NULL, 1, '[1,2,3,4,5,8,9,10,11,12]', 2, 8, NULL, NULL, 31, 1200, 9, '1', NULL, NULL, NULL, 'https://www.youtube.com/embed/fsBSidZk954', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Hàng bột nở uy tín', 'Hàng bột nở uy tín', 'Tổng quan\r\nKhu đô thị Vinh New Center tiên phong tạo lập tổ ấm hiện đại, đẳng cấp đầu tiên tại xã Nghi Liên, thành phố Vinh, tỉnh Nghệ An do công ty CP Xây dựng Sơn Hà triển khai đầu tư. Với quy hoạch', NULL, NULL, NULL, 1, 0, 1643117905, 1643384667, NULL, 12, 16, NULL, NULL, NULL, 'Phố hàng tổng', 5, '/uploads/21/project/duong-qua.jpg', '[\"\\/uploads\\/21\\/project\\/Copy%20of%20J2%20Colorful%20Energy.jpg\",\"\\/uploads\\/21\\/project\\/Copy%20of%20J2%20Crystal%20Ice.jpg\",\"\\/uploads\\/21\\/project\\/Copy%20of%20J2%20Space.jpg\",\"\\/uploads\\/21\\/project\\/duong-qua.jpg\"]', 2, 21, 21, 0, NULL),
