(13, 14, 'Minh Đức', 'uploads/users/7518199095/y5nhaAf0E5XO9KRPd2bmLJYJP0RzUtd5QNNHmQdW.png', 765392400, NULL, '000000000', NULL, NULL, NULL, NULL, NULL, 'Trên thị trường, giá cổ phiếu GMD chốt phiên sáng 05/04 tại mốc 59.900 đồng/cp, tăng 1,7% so với giá tham chiếu, khối lượng giao dịch đạt hơn 2,5 triệu cổ phiếu. So với hồi đầu năm, giá cổ phiếu đã tăng 27%.\r\n\r\nDiễn biến giá cổ phiếu GMD thời gian gần đây (Nguồn: TradinView)\r\n\r\nVề kết quả kinh doanh của GMD, năm 2021, công ty đạt 3.205,9 tỷ đồng doanh thu thuần và 721,4 tỷ đồng lợi nhuận sau thuế, lần lượt tăng trưởng 23% và 64% so với kết quả năm 2020. Trong đó, doanh thu từ hoạt động khai thác cảng đạt 2.762,4 tỷ đồng, chiếm 86,2% tổng doanh thu; còn lại 442,5 tỷ đồng (chiếm 13,8%) là doanh thu hoạt động logistics, cho thuê văn phòng khác.', 'uploads/users/7518199095/7BT6yX69CPj3TC3wdfPgtiMBu3Gllv2JihagHGLl.png', 36, NULL, NULL, NULL, '0909992638', 'minhduc3186@gmail.com', NULL, NULL, NULL, NULL),
