(5, 'N', 'CƠ CHẾ TĂNG BẬC', '<p><span style=\"color: #169179;\"><strong>CƠ CHẾ TĂNG BẬC TR&Ecirc;N HỆ THỐNG WEBSITE</strong></span></p>\r\n<p>⚡<strong> <span style=\"color: #236fa1;\">Đăng đủ số lượng tin y&ecirc;u cầu</span></strong>&nbsp; : Đăng từ 0 - 250 tin l&agrave; t&agrave;i khoản Thường, Đăng tr&ecirc;n 250 - Đến 1000 tin l&agrave; t&agrave;i khoản Đồng, Đăng tr&ecirc;n 1000 đến 3000 tin l&agrave; t&agrave;i khoản Bạc, Đăng tr&ecirc;n 3000 - đến 10.000 tin l&agrave; t&agrave;i khoản V&agrave;ng,<strong> </strong><span style=\"color: #ba372a;\">tr&ecirc;n 10.000 tin l&agrave; t&agrave;i khoản Kim Cương.&nbsp;</span></p>\r\n<p>⚡ <strong><span style=\"color: #236fa1;\">Nạp đủ số coin y&ecirc;u cầu</span></strong>&nbsp; : Nạp từ 200k trở l&agrave; l&ecirc;n t&agrave;i khoản Đồng, Nạp tr&ecirc;n 2 triệu l&agrave; t&agrave;i khoản Bạc, Nạp tr&ecirc;n 20 triệu l&agrave; t&agrave;i khoản V&agrave;ng, <span style=\"color: #ba372a;\">Nạp tr&ecirc;n 50 triệu l&agrave; t&agrave;i khoản Kim Cương</span></p>', 'co-che-tang-bac', '1653460907.gif', 1, 0, 1650003304, 1, 1663052108, 1),
